import React from 'react'

function page() {
  return (
    <div>
      <div className="flex items-center mb-4">
        {/* Add your dropdown menus here */}
        <select className="mr-3.5 py-2 px-2 text-left rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent">
          <option value="clinic">Clinic</option>
          {/* Add clinic options here */}
        </select>

        <select className="mr-3.5 py-2 px-2 text-left rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent">
          <option value="month">Year</option>
          {/* Add month options here */}
        </select>

        <select className="mr-3.5 py-2 px-2 text-left rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent">
          <option value="month">Month</option>
          {/* Add month options here */}
        </select>
      </div>

      {/* Add your graphs and other components here */}
      <div className="h-32 bg-gray-300 rounded-lg mb-4" />
      <div className="h-32 bg-gray-300 rounded-lg mb-4" />
      <div className="h-32 bg-gray-300 rounded-lg mb-4" />
    </div>
  );
}

export default page;
